The area of parallelogram $OACB$ is the magnitude of the cross product of $\overrightarrow{OA}$ and $\overrightarrow{OB}.$

\begin{align*}
\overrightarrow{OA} \times \overrightarrow{OB} &= \begin{vmatrix} \mathbf{i} & \mathbf{j} & \mathbf{k} \\ 1 & 2 & 3 \\ -3 & -2 & 1 \end{vmatrix} \\
&= (2 \cdot 1 - 3 \cdot -2) \mathbf{i} - (1 \cdot 1 - 3 \cdot -3) \mathbf{j} + (1 \cdot -2 - 2 \cdot -3) \mathbf{k} \\
&= 8 \mathbf{i} - 10 \mathbf{j} + 4 \mathbf{k}
\end{align*}The magnitude of this vector is $\sqrt{8^2 + (-10)^2 + 4^2} = \sqrt{164} = 2 \sqrt{41}.$

Therefore, the area of triangle $OAB$ is $\frac{1}{2} \cdot 2 \sqrt{41} = \boxed{\sqrt{41}}.$

