We know that a full circle is $360^{\circ}$, so we can divide $1070^{\circ}$ by $360^{\circ}$ to find the number of full circles in $1070^{\circ}$. \[
\frac{1070^{\circ}}{360^{\circ}} = 2\frac{350^{\circ}}{360^{\circ}}
\] The $2$ represents the number of full circles, and the $\frac{350^{\circ}}{360^{\circ}}$ represents the fraction of a circle that is left over. We can simplify the fraction by dividing the numerator and denominator by $10$. \[
\frac{350^{\circ}}{360^{\circ}} = \frac{35^{\circ}}{36^{\circ}}
\] Since a full circle is $360^{\circ}$, the fraction $\frac{35^{\circ}}{36^{\circ}}$ represents $\frac{35}{36}$ of a circle. Therefore, $1070^{\circ}$ is equal to $2\frac{35}{36}$ circles, or $2\frac{35}{36}$ full circles.

The direction vector of the first line is $\begin{pmatrix} 2 \\ -9 \\ -2 \end{pmatrix},$ and the direction vector of the second line is $\begin{pmatrix} 4 \\ -18 \\ -4 \end{pmatrix} = 2 \begin{pmatrix} 2 \\ -9 \\ -2 \end{pmatrix}.$  Therefore, the direction vectors are parallel, so the two lines are either parallel or skew.

The vector connecting the two points is
\[\begin{pmatrix} -5 \\ -3 \\ 6 \end{pmatrix} - \begin{pmatrix} 3 \\ -10 \\ 1 \end{pmatrix} = \begin{pmatrix} -8 \\ 7 \\ 5 \end{pmatrix}.\]This vector is not a scalar multiple of $\begin{pmatrix} 2 \\ -9 \\ -2 \end{pmatrix},$ so the two lines are skew.

[asy]
import three;

size(180);
currentprojection = perspective(6,3,2);

triple I = (1,0,0), J = (0,1,0), K = (0,0,1);
triple O = (0,-0.5,0), V = (0,1.5,0), P = (0,0,0.5), Q = (0,0,-0.5);

draw(O--(3*I));
draw(O--(3*J));
draw(O--(3*K));
draw(O--V);
draw(O--P);
draw(O--Q);
draw(P--Q,dashed);

label("$x$", (3.2*I), N);
label("$y$", (3.2*J), N);
label("$z$", (3.2*K), N);
label("$\mathbf{v}$", (V + O)/2, NE);
label("$\mathbf{p}$", (P + O)/2, NW);
label("$\mathbf{q}$", (Q + O)/2, SW);
label("$\mathbf{v} + t \mathbf{p}$", (V + P)/2, NW);
label("$\mathbf{v} + u \mathbf{q}$", (V + Q)/2, SW);
[/asy]

We can write the equations of the lines as
\[\begin{pmatrix} 3 \\ -10 \\ 1 \end{pmatrix} + t \begin{pmatrix} 2 \\ -9 \\ -2 \end{pmatrix} = \begin{pmatrix} 3 + 2t \\ -10 - 9t \\ 1 - 2t \end{pmatrix}\]and
\[\begin{pmatrix} -5 \\ -3 \\ 6 \end{pmatrix} + u \begin{pmatrix} 4 \\ -18 \\ -4 \end{pmatrix} = \begin{pmatrix} -5 + 4u \\ -3 - 18u \\ 6 - 4u \end{pmatrix}.\]Setting these equal, we get
\begin{align*}
3 + 2t &= -5 + 4u, \\
-10 - 9t &= -3 - 18u, \\
1 - 2t &= 6 - 4u.
\end{align*}Solving, we find $t = 1$ and $u = 1.$  Therefore, the two lines intersect at the point $\boxed{\begin{pmatrix} 5 \\ -19 \\ -1 \end{pmatrix}}.$

